import React from 'react';
import { Link } from 'react-router-dom';

const nav = {
    // background: 'cyan',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'space-around',
    margin: '2vw 2vw 3vw 2vw',
}

const navLinks = {
    // background: 'red',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
}

const links = {
    background: 'green',
    // margin: '0 1vw',
}

const linkText = {
    background: 'yellow',
    width: '14vw',
    textDecoration: 'underline',
    fontSize: '1.2vw',
    color: 'white',
}

function BottomNav() {
    return (
        <nav style={ nav }>
            <div style={ navLinks }>
                <Link style={links} to='/'>
                    <div style={ linkText }>HOME</div>
                </Link>
                <Link style={links} to='/about'>
                    <div style={ linkText }>ABOUT</div>
                </Link>
                <Link style={links} to='/services'>
                    <div style={ linkText }>SERVICES</div>
                </Link>
                <Link style={links} to='/projects'>
                    <div style={ linkText }>PROJECTS</div>
                </Link>
                <Link style={links} to='/contact'>
                    <div style={ linkText }>CONTACT</div>
                </Link>
            </div>
        </nav>
    );
}

export default BottomNav;
